    public boolean validTicTacToe(String[] board) {
        int cntX = 0;
        int cntO = 0;
        boolean winX = false;
        boolean winO = false;
        //对角线
        char c11 = board[1].charAt(1);
        if (c11 != ' ' && board[0].charAt(0) == c11 && c11 == board[2].charAt(2)) {
            if (c11 == 'X') {
                winX = true;
            } else {
                winO = true;
            }
        }
        if (c11 != ' ' && board[0].charAt(2) == c11 && c11 == board[2].charAt(0)) {
            if (c11 == 'X') {
                winX = true;
            } else {
                winO = true;
            }
        }
        for (int i = 0; i < 3; i++) {
            //横
            char ci0 = board[i].charAt(0);
            if (ci0 != ' ' && ci0 == board[i].charAt(1) && ci0 == board[i].charAt(2)) {
                if (ci0 == 'X') {
                    winX = true;
                } else {
                    winO = true;
                }
            }
            //竖
            char c0i = board[0].charAt(i);
            if (c0i != ' ' && c0i == board[1].charAt(i) && c0i == board[2].charAt(i)) {
                if (c0i == 'X') {
                    winX = true;
                } else {
                    winO = true;
                }
            }
            for (int j = 0; j < 3; j++) {
                char c = board[i].charAt(j);
                if (c == 'O') {
                    cntO++;
                } else if (c == 'X') {
                    cntX++;
                }
            }
        }
        if (cntX != cntO && cntX - cntO != 1) {
            return false;
        }
        if (winX && cntX - cntO != 1) {
            return false;
        }
        if (winO && cntX != cntO) {
            return false;
        }
        return true;
    }

    public boolean validTicTacToe2(String[] board) {
        char[] start = new char[9];
        Arrays.fill(start, ' ');
        Set<String> valid = new HashSet<>();
        valid.add(String.valueOf(start));
        dfs(start, valid, 0, true);
        System.out.println("\"" + String.join("\",\"", valid) + "\"");
        return valid.contains(String.join("", board));
    }

    private void dfs(char[] board, Set<String> valid, int times, boolean isX) {
        if (times == board.length) {
            return;
        }
        for (int i = 0; i < board.length; i++) {
            if (board[i] != ' ') {
                continue;
            }
            board[i] = isX ? 'X' : 'O';
            valid.add(String.valueOf(board));
            if (!win(board, i)) {
                dfs(board, valid, times + 1, !isX);
            }
            //还原
            board[i] = ' ';
        }
    }

    private boolean win(char[] b, int pos) {
        int x = pos / 3;
        int y = pos % 3;
        //横
        if (b[x * 3 + (y + 1) % 3] == b[pos] && b[x * 3 + (y + 2) % 3] == b[pos]) {
            return true;
        }
        //竖
        if (b[(x + 1) % 3 * 3 + y] == b[pos] && b[(x + 2) % 3 * 3 + y] == b[pos]) {
            return true;
        }
        //对角线
        if (x == y && b[(x + 1) % 3 * 3 + (y + 1) % 3] == b[pos] && b[(x + 2) % 3 * 3 + (y + 2) % 3] == b[pos]) {
            return true;
        }
        if (((x == 1 && y == 1) || Math.abs(x - y) == 2) && b[(x + 1) % 3 * 3 + (y + 2) % 3] == b[pos] && b[(x + 2) % 3 * 3 + (y + 1) % 3] == b[pos]) {
            return true;
        }
        return false;
    }

